      <MapView
        provider={PROVIDER_GOOGLE}
        style={styles.map}
        initialRegion={{
          latitude: 31.769218,
          longitude: 35.164061,
          latitudeDelta: 0.3,
          longitudeDelta: 0.3,
        }}
      >
        <Marker
          coordinate={{ latitude: 31.769218, longitude: 35.164061 }}
          title={"title"}
          description={"description"}
        />
      </MapView>
    </Background>
  );
}
const styles = StyleSheet.create({
  map: {
    width: "100%",
    height: "100%",
  },
});
